clc ; clear;
%%

M_w = 4.3;   % Mass of one wheel
M_r = 10.12;   % Mass of robot body
m_b = 0.00271;  % Mass of the ball
R = 0.356;    % Radius of the wheel
h = 0.31665;     % Height of robot CoM from ball platform
r = 0.04006;   % Radius of the ball
g = 9.81;    % Gravity
d = 0.18865; 

% Safety limits
x_limit = d/4;                 % ball can move only within +/- d/2
theta_limit = deg2rad(15);     % 15 degrees in radians

% --- 2. Moments of Inertia ---
I_w = 0.5 * M_w * R^2;        % Inertia of one wheel (Note: Not used in M1, M2, M3)
I_r_com = (1/12) * M_r * (h^2 + d^2);       % body about its own COM
I_r = I_r_com + M_r * d^2;              % Inertia of robot body (parallel axis theorem)
I_b = 0.4 * m_b * r^2;      % Inertia of a solid sphere ball

% % --- 3. Derived Parameters ---
l = h + r; % Height of ball CoM from wheel center
% 
% 
M1 = [(I_b/(r^2)) + m_b, m_b*l;
      m_b*l,            I_r + m_b*(l^2)];

% M2 = [[1,  1+(g*m_b)],
%       [1-(m_b*g), 1 - (M_r*d*g)-(m_b*g*l)]]
M2 = [0,             (g*m_b);
      (m_b*g), (M_r*d*g) + (m_b*g*l)];

% M3 = [[m_b*l],
%       [-m_b]]
M3 = -[m_b*l;
      I_r+ m_b*l^2];

% --- 5. Calculate A and B ---
% This is the numerically preferred method for A = inv(M1) * M2
A1 = M1 \ M2;

% This is the numerically preferred method for B = inv(M1) * M3
B1 = M1 \ M3;
%%
A = [0 1 0 0;... %[output:group:67409247] %[output:28ac8dce]
    A1(1,1) 0 A1(1,2) 0;... %[output:28ac8dce]
    0 0 0 1;... %[output:28ac8dce]
    A1(2,1) 0 A1(2,2) 0] %[output:group:67409247] %[output:28ac8dce]
B = -[0 ; B1(1); 0 ; B1(2)] %[output:8c0fde09]
C = eye(4) %[output:2a3a9b65]
D = zeros(4,1) %[output:758f093a]
%%
[num,den] = ss2tf(A,B,C,D) %[output:6aa304a2] %[output:9606fb8f]
%%
function info = impulseinfo(t, y)
    % simplified impulse-response info
    % fields: Peak, SettlingTime, Overshoot

    y = y(:);
    t = t(:);

    % Peak
    [Peak, ~] = max(abs(y));

    % Final value
    final_val = y(end);

    % Overshoot (only meaningful if final != 0)
    if abs(final_val) > 1e-6
        Overshoot = (Peak - abs(final_val)) / abs(final_val);
    else
        Overshoot = NaN;   % consistent with control theory practice
    end

    % Settling time (2% band)
    err = abs(y - final_val);
    tol = 0.02 * abs(final_val);
    idx_set = find(err <= tol, 1, 'first');
    if ~isempty(idx_set)
        SettlingTime = t(idx_set);
    else
        SettlingTime = NaN;
    end

    info = struct('Peak', Peak, ...
                  'SettlingTime', SettlingTime, ...
                  'Overshoot', Overshoot);
end

%%
s = tf('s');
G_theta = tf(num(3,:), den);
Kp_t = 3000; % Proportional gain
Ki_t = 10; % Integral gain
Kd_t = 25; % Derivative gain
C_theta = pid(Kp_t, Ki_t, Kd_t);
T_theta = feedback(C_theta*G_theta, 1);
pole(T_theta) %[output:6a9e5b0c]
impulse(T_theta) %[output:798875ee]
%%
sys = ss(A,B,C,D);     % 1 input (u), 4 outputs: [x; dx; θ; dθ]
C_theta = pid(Kp_t, Ki_t, Kd_t);   % tuned so θ response is fast & well damped
% inner_cl: input = θ_ref, outputs = [x; dx; θ; dθ]
inner_cl = feedback(sys, C_theta, 1,3);
%%
poles_inner = pole(inner_cl);
fprintf('Inner loop poles:\n'); %[output:92efcdbc]
disp(poles_inner); %[output:2b0d9371]

% Check that all poles are in LHP (real part < 0)
if all(real(poles_inner) < 0) %[output:group:1ad1c2df]
    fprintf('Inner loop is STABLE ✓\n'); %[output:74113000]
else
    fprintf('Inner loop is UNSTABLE ✗\n');
end %[output:group:1ad1c2df]

%%
figure; %[output:7de575e9]
impulse(inner_cl(3,1), 2);  % θ (output 3) due to θ_ref (input 1) %[output:7de575e9]
title('Inner Loop: θ Response to θ_ref Step'); %[output:7de575e9]
grid on; %[output:7de575e9]
%%
% Get transfer function from θ_ref to x
Gx_outer = tf(inner_cl(1,1));  % x (output 1) / θ_ref (input 1)
Gx_outer = minreal(Gx_outer);  % clean up

fprintf('Outer loop plant (θ_ref → x):\n'); %[output:4d3dbe3f]
disp(Gx_outer); %[output:0676f9ed]

% Check its poles
poles_outer = pole(Gx_outer);
fprintf('Outer plant poles:\n'); %[output:1dcc90b1]
disp(poles_outer); %[output:946781d6]

% Quick sanity check
figure; impulse(Gx_outer, 2); %[output:4ba44ff4]
title('Outer Plant: x Response to θ_ref'); %[output:4ba44ff4]
grid on; %[output:4ba44ff4]
%%
% Design outer controller
figure; rlocus(Gx_outer); grid on; %[output:733933a2]
title('Root Locus for Outer Loop (x control)'); %[output:733933a2]


Kp_x = 5.0;
Ki_x = .01000;
Kd_x = 41;


C_x = pid(Kp_x, Ki_x, Kd_x);
T_x = feedback(-C_x*Gx_outer, 1);   % minus sign here

impulse(T_x); grid on; %[output:758421a8]
pole(T_x) %[output:5c9ed17c]
%%
% Combine both loops
C_x = -pid(Kp_x, Ki_x, Kd_x);  % your tuned outer controller
G_total = series(C_x, inner_cl);  % x_ref → θ_ref → [x;...]
T_total = feedback(G_total(1,1), 1);  % close outer feedback

% Simulate step response
figure; impulse(T_total, 700); %[output:140bd684]
title('Complete Ballbot: x Response to x_ref'); %[output:140bd684]
grid on; hold on; %[output:140bd684]
plot([0 5], [x_limit x_limit], 'r--', 'LineWidth', 1.5); %[output:140bd684]
plot([0 5], [-x_limit -x_limit], 'r--', 'LineWidth', 1.5); %[output:140bd684]
legend('Response', 'Safety Limit'); %[output:140bd684]
xlabel('Time (s)'); ylabel('Ball Position x (m)'); %[output:140bd684]

% Check performance
stepinfo(T_total) %[output:7ac28221]
%%
[num_x, den_x] = tfdata(Gx_outer, 'v');


